import React, { Fragment } from 'react';
import Card from './card';
import indiefetto2 from '../Indiefetto2.png'
import About from './About';

const ThreeColumnsPage = () => {
    return (

        <Fragment>
        <div className="flex flex-row sm:flex-row">
            <div className=" sm:w-1/3 p-4 mt-10">
                <img className='rounded-full shadow-xl sm:m-20 relative' src={indiefetto2} />
            </div>
            <div className=" sm:w-1/3 p-4">
                <Card />
            </div>
           

            
            
        </div>
        <About />
        </Fragment>
        
    );
};

export default ThreeColumnsPage;
